function DisplayMultipleFileSelectors(theMenu)
{
for (i = 1 ; i <= 10 ; i++)
	if (theMenu.options[theMenu.selectedIndex].value >= i) document.getElementById("upload" + i).style.display = "block";
	else document.getElementById("upload" + i).style.display = "none";
}

function UploadFiles()
{
